import React from 'react';

import Post from './Post'; 

export default class App extends React.Component {
    render(){
        return (
        <div>            
            <h1>Brn Tecnology</h1>
            <p>todas atualizações sobre tecnologia encontre aqui.</p>
            <Post title="AConsola (PS5, XBOXXbox Series X), OU UM PC GAMER?" pag="Vamos aqui de forma resumida falar das coisas positivas e negativas dos novos super consoles da sony (o PS5) e da microsoft( Xbox Series X), e de um pc gamer sabendo que a um grande diversidade de gameres no mercado Angolano como internacional.
Embora os consoles não estando livremente disponíveis em Angola é momento de começar a fazer já a revisão do produto e saber se aquela compra valerá apena.
PC Gamer
Pontos positivos
+Pode ser mais poderoso.
O primeiro ponto positivo de ter um PC gamer é a possibilidade de montar um computador mais poderoso, superior tanto ao PlayStation 5 (PS5) quanto ao Xbox Series X. É possível equipar a máquina com processadores mais rápidos e com mais núcleos.
'Jogos mais baratos.
Outro ponto positivo do computador enquanto uma plataforma de games está na oferta de jogos. Nos PCs, jogos têm preços mais baixos, em média. Além disso, as promoções de lojas como a Steam e Epic oferecem descontos muito mais agressivosdo que as ofertas para Xbox e PlayStation, por exemplo.
Pontos negativos
Menor custo-benefício.
"/>
            <Post title="" pag="Nokia é a marca de celular Android mais confiável." pag="A Nokia é uma empresa de telefones que conquistou o mundo e os angolanos com os seus aparelhos bem duradouros e potentes nos anos 2005-2011.
a Nokia tentou se juntar com a microsoft e usou o windowsphone em alguns aparelhos nos anos de 2012-2016. nos nossos dias usam o sistema internacionalizado o Android, e atualmente é um dos aparelhos mais seguro e que merece muita confiança dos seus utilizadores por ser o melhor da plataforma Android, por dois simples motivos.
-A Nokia é a marca Android mais segura e duradoura.
-Atualizações do sistema e de segurança."/>
            <Post title="Apple anuncia evento para novembro e pode lançar Mac com chip próprio" pag="intitulado -One More Thing- (Mais Uma Coisa na tradução do inglês), o evento vai acontecer na terça-feira que vem, dia 10 de novembro, às 19:00 (horário de Angola). Rumores apontam que a Apple vai apresentar uma nova linha de MacBooks com processadores Apple Silicon, CPUs exclusivamente desenvolvidas pela companhia e que são usadas nos iPhones e iPads." />
        </div>
        );
    }
}
